import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';
import Cookies from 'js-cookie';
import { useNavigate } from 'react-router-dom';
import AcceptRejectButtons from './AcceptRejectButtons'; // Import the AcceptRejectButtons component

const MyProfile = () => {
    const [user, setUser] = useState(null);
    const { id } = useParams();
    const [myRequests, setMyRequests] = useState([]);
    const [showRequests, setShowRequests] = useState(false);
    const navigate = useNavigate();
    const cookieValue = Cookies.get('UserId') || '';

    useEffect(() => {
        if (!cookieValue) {
            navigate('/');
        } else {
            navigate(`/Profile/${cookieValue}`);
        }
    }, [cookieValue, navigate]);

    useEffect(() => {
        axios.get(`http://localhost:8080/Auth/show/${id}`)
            .then(response => setUser(response.data))
            .catch(error => console.error('Error fetching User:', error));
    }, [id]);

    const handleMyRequests = async (event) => {
        event.preventDefault();
        try {
            const response = await axios.get(`http://localhost:8080/Hostings/ShowAllRequests/${id}`);
            setMyRequests(response.data);
            setShowRequests(true);
        } catch (error) {
            console.error('Error fetching requests:', error);
        }
    };

    const handleAcceptRequest = async (localId, guestId) => {
        try {
            await axios.put(`http://localhost:8080/Hostings/AcceptRequest/${localId}`, {
                guestId: guestId
            });
            const updatedRequests = myRequests.filter(request => !(request.localId === localId && request.guestId === guestId));
            setMyRequests(updatedRequests);
            console.log("Request accepted:", localId);
        } catch (error) {
            console.error('Error accepting request:', error);
        }
    };

    const handleRejectRequest = async (localId, guestId) => {
        try {
            await axios.put(`http://localhost:8080/Hostings/RejectRequest/${localId}`, {
                guestId: guestId
            });
            const updatedRequests = myRequests.filter(request => !(request.localId === localId && request.guestId === guestId));
            setMyRequests(updatedRequests);
            console.log("Request rejected:", localId);
        } catch (error) {
            console.error('Error rejecting request:', error);
        }
    };

    if (!user) {
        return null;
    }

    return (
        <section className="h-100 gradient-custom-2">
            <div className="container py-5 h-100">
                <div className="row d-flex justify-content-center align-items-center h-100">
                    <div className="col col-lg-9 col-xl-7">
                        <div className="card">
                            {/* User Profile Content */}
                            {/* Profile Editing Section */}
                        </div>
                        <div className="p-4 text-black" style={{ backgroundColor: '#f8f9fa' }}>
                            <button type="button" className="btn btn-outline-dark" onClick={handleMyRequests}>
                                My Requests
                            </button>
                            {showRequests && (
                                <div>
                                    <table>
                                        <thead>
                                            <tr>
                                                <th>Local Id</th>
                                                <th>Local Title</th>
                                                <th>Guest Name</th>
                                                <th>Action</th>
                                            </tr>
                                        </thead>
                                        <tbody>
                                            {myRequests.map((request, index) => (
                                                <tr key={index}>
                                                    <td>{request.localId}</td>
                                                    <td>{request.localName}</td>
                                                    <td>{request.guestName}</td>
                                                    <td>
                                                        {/* Use the AcceptRejectButtons component */}
                                                        <AcceptRejectButtons
                                                            localId={request.localId}
                                                            guestId={request.guestId}
                                                            onAccept={handleAcceptRequest}
                                                            onReject={handleRejectRequest}
                                                        />
                                                    </td>
                                                </tr>
                                            ))}
                                        </tbody>
                                    </table>
                                </div>
                            )}
                        </div>
                        {/* Other Sections */}
                    </div>
                </div>
            </div>
        </section>
    );
}

export default MyProfile;
